import './App.css';
import FixedIcons from './components/FixedIcons';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from './pages/About';

function App() {
  return (
    <div className="container">
      <Router>
        <Navbar></Navbar>
        <FixedIcons />

        <Routes>
          <Route path='/about'>
            <About />
          </Route>
        </Routes>


      </Router>
    </div>
  );
}

export default App;
